"Comment text","Game Tags","Loading discussions ...","Likely best move - analyzing ...","Gold","Here's a list of all the mistakes in the game.","Good move","Approval required for subscription change","AI","instant","Legal Notice","Feedback","Your nickname and rank is shown to others when you participate in discussions.","Cancel Subscription","Gold Trophy","Mistake!","Remember this move for the next time.","My color","Select File",'There are four subscription levels that differ in analysis strength and length of the shown variations:\n| Plan  | Playouts | Variation Length | Sample | Monthly Price |\n| :------------ | ------------: | :------------ | :-----------: | :-----------: |\n| Free | 50   |  about 4 moves | [Link](https://ai-sensei.com/game/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-MEOHXb-aWU8XYdK2crS) | **FREE** |\n| Basic | 500   | about 10 moves | [Link](https://ai-sensei.com/game/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-MEOH_QbtwiqJ0RcAf28) | \x26nbsp;\x26nbsp;5.95 $ \x26nbsp;or\x26nbsp; 4.95 € |\n| Dan | 2500   | about 15 moves |  [Link](https://ai-sensei.com/game/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-MEOHcgRXzZZ4nYCsUTr) | 11.95 $ \x26nbsp;or\x26nbsp; 9.95 € |\n| Pro | 10000 | about 18 moves | [Link](https://ai-sensei.com/game/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-MEOHeLyW7TRfrXn513c) | 27.95 $ or 24.95 € |\n\n\x3cbr\x3e\n__You can cancel anytime by choosing "Free" again. You will keep the plan until the end of the period.__\n\n**Free** is for occasional players or to try out AI Sensei. With 50 playouts, the AI should already beat many pro players in a game, but it might misread life \x26 death situations sometimes. Its AI variations are about 4 moves long.\n\n**Basic** gives you access to high quality reviews for a small price. Using 500 playouts, the AI has superhuman strength and will output variations that are about 10 moves long, depending on the position ...\n\n**Dan** offers ambitious students a powerful analysis. Its 2500 playouts per move result in very precise and deep reading. The variations are about 15 moves on average, sometimes even longer.\n\n**Pro** is intended for the most intensive Go training. Using 10000 playouts, it will give you variation lengths of about 18 moves on average.\n\nThe sample game links above show the same game analyzed with all levels, so you can compare the differences for yourself.\n\n#### So which one should I take now?\nWhen in doubt, just start with **Basic**. It\'s really good already. Then you can always upgrade if you need more.',
